import React from 'react';
import {Form,Jumbotron} from 'react-bootstrap'
 
function Eventreg() {
    return (
        <div>
            <h3>Create New Event</h3>
            <Jumbotron >
            <Form.Group controlId="text">
    <Form.Label>NAME</Form.Label>
    <Form.Control type="text" placeholder="" />
  </Form.Group>
  </Jumbotron>

            
        </div>
    )
}

export default Eventreg
